import React,{Component} from 'react';
import {Table} from 'reactstrap';

export default class SharedTable extends Component{
	constructor(props){
		super(props);
	}

	render(){
		console.log(this.props)
		const header=this.props.header.map((k)=>{
			return(
				<th>{k}</th>
			)
		});

		const parsedData=this.props.dataValue.map((k)=> {
			return(
				<tr>
					{this.props.tdValues.forEach(function(e){
						if(e===k){
							return <td>e</td>
						}
					})}
				</tr>
			)
		});

		return(	
			<Table>
				<thead>
					{header}
				</thead>
				<tbody>
					{parsedData}
				</tbody>
			</Table>
		)
	}
}
